import React from "react";
import {Link} from "react-router-dom";
import {Stack} from "@mui/material";
import Logo from "../Assests/Image/Logo.jpg";

const Navbar=()=>{
    return(
        <Stack>
            <Link to="/">
                <img src={Logo} alt="logo" style={{width:'48px', height:'48px'}}/>
            </Link>
        </Stack>
    )
}

export default Navbar;
